import { useState } from "react";
import Form from "./component/From/Form";
import Header from "./component/Header/Header";
import Sidebar from "./component/Sidebar/Sidebar";

function App() {

  const [name, setName] = useState();
  
  return (
    <div className="App">
      <Header name={name} />
      <div className="main">
        <Sidebar name={name} />
        <Form />
      </div>
    </div>
  );
}

export default App;
